import React from 'react';
import PlanetCard from './PlanetCard'

const Content = ({ planets }) => {
    return (
        <div>
            {planets.map((planet) => {
                return (
                    <PlanetCard
                        key={planet.name}
                        name={planet.name}
                        climate={planet.climate}
                        gravity={planet.gravity}
                        terrain={planet.terrain}
                    />
                );
            })}
        </div>
    );
}

export default Content;
